import React, { Component } from 'react'
import FeedItem from './plateFeedItem'
import Axios from 'axios'
// import Search from './autoCompSearch'

let FeedStyle = {
   overflow: 'scroll'
}

class platesFeed extends Component {

    state = {
        plateCollection: [],
        feed: []
    }

    getRegisterData  = async() => { 
        let getData =  await Axios.get('/api/get/getPlates')
        console.log(getData.data)
        this.setState({plateCollection: getData.data})
    }

    updateFeedList = () => {
        let feed = []
        this.state.plateCollection.map((plate) => {
            feed.push(<FeedItem
                plateNumber = {plate.plateNumber}
            />)
        })
        this.setState({feed: feed})
    }

    componentDidMount(){
        this.getRegisterData()
        this.updateFeedList()
        console.log(this.state.feed)
    }

    render(){
        return(
            <div>
                <h1>Active Plates</h1>
                <div style={FeedStyle}>
                    <FeedItem plateNumber='12345-69'></FeedItem>
                    <FeedItem plateNumber='56789-10'></FeedItem>
                </div>
            </div>
        )
    }
}

export default platesFeed
